import { View, StyleSheet } from "react-native";

const ProfileScreen = () => {
  return (
    <View style={styles.main}>
      <View style={styles.parent}></View>
    </View>
  );
};

const styles = StyleSheet.create({
  main: {
    flex: 1,
    backgroundColor: "#fff",
    borderColor: "grey",
    borderWidth: 1,
  },
  parent: {
    marginHorizontal: 20,
    marginVertical: 40,
  },
});

export default ProfileScreen;
